import React from 'react'

import Button from '@material-ui/core/Button';
const Index = (props) => {
    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} type="primary"
        style={{ background: "green", borderColor: "yellow" }}
        className={props.className + " btn btn-success"}>{props.text}</Button>
}

export default Index;
